import { getRecommend } from "../services/music_services"
import { useEffect } from "react"
import { changeRecommends } from "../reducers/musicReducers"
import { useDispatch, useSelector } from "react-redux"

const Recommend = () => {
    const dispatch = useDispatch()
    const recommendList  = useSelector(state=>state.recommended)
    const recommends = useSelector(state=>state.recommended)
    useEffect(()=>{
        getRecommend()
            .then( res => {
                dispatch(changeRecommends(res))
            })
    },[])
    return(
        <div className="recommendContainer">
            {recommends.songs
                ? console.log(`Empty`)
                : console.log(`Not empty ${recommends.songs}`)}
        </div>
    )
}
export default Recommend
